import styled from "styled-components";
export const HeaderWrapper = styled.div`
    .header-top {
        width: 100%;
        display: flex;
        justify-content: space-between;
        align-items: center;
        padding: .25rem 3rem;
        & > img {
            width: 20%;
        }
    }
`
